import React from 'react';
import NavBar from './NavBar'
import './App.css';
import { Home } from './Home';
import { Contact } from './Contact';
import About from './About';
import NoMatch from './NoMatch';
import Layout from './Layout';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <React.Fragment>
      <Layout>
        <Router>
          <Switch>
            <Route exact path="/" component={Home}/>
            <Route path="/about" component={About}/>
            <Route path="/contact" component={Contact}/>
            <Route component={NoMatch}/>
          </Switch>
        </Router>
      </Layout>
    </React.Fragment>
      // <NavBar/>
      // <header className="App-header">
      //   <img class="center-img" src="https://upload.wikimedia.org/wikipedia/commons/2/2d/Epitech.png" alt="My Logo" title="" width="30%" height="30%"/>
      //   <h1 class="text-color center-text"> Portfolio de Samuel </h1>
      //   <p class="center-text-description">
      //   Hello ! Je m'appelle Samuel. Je suis un étudiant à Epitech.
      //   </p>
      //   <h2 class="text-color center-text"><u> Mes Projets </u></h2>
      // </header>
  );
}

export default App;
